import React from "react";

const About = () => {
  return (
    <div >
      <p className="portfolio">
        Hola, mi nombre es Cristian Molina, tengo 39 años y actualmente estoy
        estudiando programación en Henry. Me encuentro en el Módulo 2 de la
        carrera y estoy emocionado por todo lo que estoy aprendiendo.
        Actualmente, estoy trabajando en un proyecto de desarrollo de
        aplicaciones web utilizando React, específicamente la creación de la
        aplicación de Rick and Morty. Desde siempre he tenido una gran pasión
        por la tecnología y la informática, lo que me llevó a iniciar mis
        estudios en este campo. Como estudiante, me considero una persona
        autodisciplinada y comprometida con el aprendizaje constante, lo que me
        motiva a seguir adelante y superar cualquier obstáculo que se presente
        en el camino. Estoy emocionado por seguir aprendiendo, creciendo y
        desarrollando mis habilidades como programador. Espero poder continuar
        explorando nuevas tecnologías y herramientas, y aplicar mis
        conocimientos para crear soluciones innovadoras y creativas en el mundo
        digital.
      </p>
    </div>
  );
};

export default About;

